import React from 'react'

import  './Button.css'

const button = ( props ) => {
    let style = {};
    if (props.value==='=') {
        style['color'] = '#0CB999';
    }

    return (<input type="button"
                   id={props.id}
                   value={props.value}
                   onClick={props.clicked} style={style}/>);
};
export default button;
